import React, { useState } from "react";

const StopWatch = () => {
  const [count, setCount] = useState(0);
  const handleStart = () => {};
  const handleStop = () => {};
  return (
    <div>
      <h2>Count {count}</h2>
      <div>
        <button onClick={handleStart}>Start</button>
        <button onClick={handleStop}>Stop</button>
      </div>
    </div>
  );
};

export default StopWatch;
